B.Lc=new A.fx("umore","uMore | AI-Powered mental well-being tracker mobile app","UX/ UI Design","I\u2019m currently working for this startup since August 2022. My role, as part of a UX design team, is mantain the product usable, enjoyable, and accessible.\n          \nMy firsts asignements where to do an audit of the existing app and give feedback about UX/UI design; create  a setup for notifications for daily check-in reminders; creating a new colour palette and the very important task of checking accesibility for our colour palette in a new feature we where launching.\n          \nFor the past few months I been working into the \u201cBuddies\u201d features.  I created  some form of interacion between the users of the app through \u201cstories\u201d about their mood. I also design the possibility to exchange presettled messeges betwen them.\n          \nOne of my most challenging job was being in charge of the creation of the Design System. This was a  collaborative task between all members of the Product team, as we utilize agile methods.\n          \nIn occasional times I had colaborated with the UX Resarch, testing features and creating new user personas.\n          ","cover.webp",B.lx,B.GN,B.lu,B.Gn,!0,4)
