B.La=new A.fx("eco","Eco Shop mobile app","UX/UI Design- Design System","This project was motivated by my commitment with the environment.  What we consume affects the planet and our health so this work was my contribution to the cause.\n          \nThe objective with this design was to build for the client a mobile app for their Eco shop to attend the needs of their consumers in the purchase of their products quickly and efficiently.\n          \nI use the Design Thinking method from the start till the end of the complete process.\n          \nUX Research and Usability Testings were the key to build this product.  Also, I create a Design System with guidelines in order to make a more consistent UI.","cover.webp",B.ex,B.ly,B.H2,B.FD,!1,0)
